import React from 'react'
import '../css/NavigationBar.css';

function NavigationBar() {
    return (
        <>
            <nav className='container-fluid navbar-main'>

                <div className="row">
                    <div>
                        <img className='navbar-logo' src="/assets/logo.png" alt="logo" />
                    </div></div>
            </nav>
        </>
    );
}

export default NavigationBar;
